import {FaShoppingCart} from "react-icons/fa";
import { NavLink } from "react-router-dom";

const Navbar = () => {
  return (
    <div>
      <div className="flex flex-row justify-between">
        <NavLink>
          <div>
          <img src="https://www.google.com/imgres?imgurl=https%3A%2F%2Fimages.unsplash.com%2Fopengraph%2F1x1.png%3Fauto%3Dformat%26fit%3Dcrop%26w%3D1200%26h%3D630%26q%3D60%26mark-w%3D64%26mark-align%3Dtop%252Cleft%26mark-pad%3D50%26blend-w%3D1%26mark%3Dhttps%253A%252F%252Fimages.unsplash.com%252Fopengraph%252Flogo.png%26blend%3Dhttps%253A%252F%252Fimages.unsplash.com%252Fphoto-1605902711622-cfb43c4437b5%253Fcrop%253Dfaces%25252Cedges%2526cs%253Dtinysrgb%2526fit%253Dcrop%2526fm%253Djpg%2526ixid%253DM3wxMjA3fDB8MXxzZWFyY2h8Nnx8c2hvcHBpbmclMjBhcHB8ZW58MHx8fHwxNjk2ODM5Mzc4fDA%2526ixlib%253Drb-4.0.3%2526q%253D60%2526w%253D1200%2526auto%253Dformat%2526h%253D630%2526mark-w%253D750%2526mark-align%253Dmiddle%25252Ccenter%2526blend-mode%253Dnormal%2526blend-alpha%253D10%2526mark%253Dhttps%25253A%25252F%25252Fimages.unsplash.com%25252Fopengraph%25252Fsearch-input.png%25253Fauto%25253Dformat%252526fit%25253Dcrop%252526w%25253D750%252526h%25253D84%252526q%25253D60%252526txt-color%25253D000000%252526txt-size%25253D40%252526txt-align%25253Dmiddle%2525252Cleft%252526txt-pad%25253D80%252526txt-width%25253D660%252526txt-clip%25253Dellipsis%252526txt%25253Dshopping%25252520app%2526blend%253D000000&tbnid=yLf_wdSbsfRTGM&vet=12ahUKEwik1u-Vg_CBAxVjoekKHfrxALEQMygqegUIARDLAQ..i&imgrefurl=https%3A%2F%2Funsplash.com%2Fs%2Fphotos%2Fshopping-app&docid=P5pl0NChGDeT3M&w=1200&h=630&q=shopping%20app%20images&ved=2ahUKEwik1u-Vg_CBAxVjoekKHfrxALEQMygqegUIARDLAQ"/>
          </div>
        </NavLink>
        <div>
          <NavLink>
            <p>Home</p>
          </NavLink>
          <NavLink>

          </NavLink>
        </div>
        
        
      </div>
    </div>
  );
};

export default Navbar;
